import React from 'react';
import jsPDF from 'jspdf'
import 'jspdf-autotable'
import DUMMY_DATA from './data';

function ShowData() {



  const downloadPdf = () => {
    const doc = new jsPDF()
    doc.text("Universidad del bosque", 20, 10)
    doc.text("Proceso de admisiones pregrado de Medicina", 40, 10)
    doc.text("Segundo Periodo Acamedico de 2019", 20, 10)
    doc.text("Salon I104", 20, 10)
    doc.autoTable({
      theme: "grid",
      head : ["id","Documento","Nombre", "Firma"],
      columns: DUMMY_DATA.map((col) => col.documento),

      body: DUMMY_DATA
    })
    doc.save('table.pdf')
  }

  return (
    <div className="App">
      <h1 align="center">React-App</h1>
      <h4 align='center'>Export Data to Pdf in Material Table</h4>
      <button onClick={downloadPdf}>Exportar</button>

    </div>
  );
}

export default ShowData;
